import Home from "./home/Home";
import './app.css';
import { Route, Routes, BrowserRouter, Redirect } from "react-router-dom";
import Details from "./home/movie/Details";
import NewMovie from "./home/movie/NewMovie";
import Login from "./home/login/Login";
import Register from "./home/register/Register";

const App = () => {
  const user = true;
  return (
    <BrowserRouter>
        <Routes>
          <Route exact path="/" element={<Home />}/>
          <Route path="/login" element={<Login />}/>
          <Route path="/register" element={<Register />}/>
          <Route path="/movies" element={user ? <Home /> : <Redirect to="register" />}/>
          <Route path="/watch" element={<Details />}/>
          <Route path="/newMovie" element={<NewMovie />}/>
        </Routes>
      </BrowserRouter>
  );

};

export default App;
